Function ZYkcddGX {
 
    [CmdletBinding()]
    [OutputType([byte[]])]
    param(
        [Parameter(Mandatory=$true)] [String]$mPiDtwP
    )
    $TqpwNpsG = New-Object -TypeName byte[] -ArgumentList ($mPiDtwP.Length / 2)
    for ($i = 0; $i -lt $mPiDtwP.Length; $i += 2) {
        $TqpwNpsG[$i / 2] = [Convert]::ToByte($mPiDtwP.Substring($i, 2), 16)
    }

